import React from "react";

import "./Registration.css";
import { NavLink } from "react-router-dom";
import { AUTH_ROUTE } from "../../utils/constants";

export default class Registration extends React.Component {
  constructor() {
    super();
    let email;
    let emailIsValidate;

    let password;
    let passwordIsValidate;

    let repassword;
    let repasswordIsValidate;

    let emailColor;
    let passwordColor;
    let repasswordColor;

    this.state = {
      email,
      password,
      repassword,
      emailIsValidate,
      passwordIsValidate,
      repasswordIsValidate,
    };

    this.onEmailChange = this.onEmailChange.bind(this);
    this.onPasswordChange = this.onPasswordChange.bind(this);
    this.onRepasswordChange = this.onRepasswordChange.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);
  }
  emailValidate(email) {
    return email.search(
      /^([A-z0-9_.-]{1,})@([A-z0-9_.-]{1,}).([A-z]{2,8})$/
    ) !== -1
      ? true
      : false;
  }

  passwordValidate(password) {
    return password.length > 5;
  }

  onPasswordChange(e) {
    let val = e.target.value;
    let valid = this.passwordValidate(val);
    this.setState({ password: val, passwordIsValidate: valid });
   this.passwordColor = this.state.passwordIsValidate ? "green" : "red";
  }

  repasswordValidate(password) {
    return password === this.state.password;
  }

  onRepasswordChange(e) {
    let val = e.target.value;
    let valid = this.repasswordValidate(val);
    this.setState({ repassword: val, repasswordIsValidate: valid });
    this.repasswordColor = this.state.repasswordIsValidate ? "green" : "red";
  }

  onEmailChange(e) {
    var val = e.target.value;
    console.log(val);
    var valid = this.emailValidate(val);
    this.setState({ email: val, emailIsValidate: valid });
    this.emailColor = this.state.emailIsValidate ? "green" : "red";
  }

  handleSubmit(e) {
    e.preventDefault();
    if (this.state.nameValid === true && this.state.ageValid === true) {
      alert(`Имя: ${this.state.name} Возраст: ${this.state.age}`);
    }
  }

  render() {
    console.log(this.state.email, this.state.emailIsValidate);
    let emailColor = this.state.emailIsValidate ? "green" : "red";

    let passwordColor = this.state.passwordIsValidate ? "green" : "red";
    let repasswordColor = this.state.repasswordIsValidate ? "green" : "red";

    return (
      <div className='container registration-container'>
        <h2>Регистрация</h2>
        <form className='form sign-up-form' onSubmit={this.handleSubmit}>
          <div>
            <label>Email:</label>
            <br />
            <input
              type='text'
              value={this.state.email}
              onChange={this.onEmailChange}
              style={{ borderColor: this.emailColor }}
            />
          </div>
          {!this.state.emailIsValidate && (
            <p className='errors'>Ввведите корректный email</p>
          )}
          <div>
            <label>Пароль:</label>
            <br />
            <input
              type='password'
              value={this.state.password}
              onChange={this.onPasswordChange}
              style={{ borderColor: this.passwordColor }}
            />
          </div>
          {!this.state.passwordIsValidate && (
            <p className='errors'>Пароль должен содержать минимум 6 символов</p>
          )}
          <div>
            <label>Повторите пароль:</label>
            <br />
            <input
              type='password'
              value={this.state.repassword}
              onChange={this.onRepasswordChange}
              style={{ borderColor: repasswordColor }}
            />
          </div>
          {!this.state.repasswordIsValidate && (
            <p className='errors'>Пароли должны совпадать!</p>
          )}
          <input type='submit' value='Отправить' />
        </form>
        <div className='sign-in'>
          <p>Уже есть аккаунт?</p>
          <NavLink className='sign-in_link' to={AUTH_ROUTE}>
            Войдите
          </NavLink>
        </div>
      </div>
    );
  }
}
